import React, { Component } from 'react';
import { firebaseDatabase } from '../utils/firebaseUtils';

var database = firebaseDatabase.ref();

export default class System extends Component {
    render() {
        return (
            <div>
                <h1>
                    Teste
                </h1>
                <span>
                    {database.child('active')}
                </span>
            </div>
        );
    }
};
